import React, { Fragment } from 'react';
import PropTypes from "prop-types";

const Gasto = ({ gasto }) => (
    <>
        <li className="gastos">
            <p>
                {gasto.nombre}

                <span className="gasto">
                    ${gasto.cantidad}
                </span>
            </p>
        </li >
        <div></div>
        <button className="button-primary ">
            x
         </button>
    </>
);

Gasto.propTypes = {
    gasto: PropTypes.object.isRequired
}

export default Gasto;
